import React, { useEffect, useState } from "react";
import { getRunnerByEmail, createOrUpdateRunner, getWorkoutsForRunner } from "../services/api";
import Header from "../styles/Header.js";
import Footer from "../styles/Footer.js";
import "../styles/Home.css";

const Home = () => {
  const [selectedRunner, setSelectedRunner] = useState(null);
  const [weeks, setWeeks] = useState([]);
  const [error, setError] = useState("");
  const [email, setEmail] = useState("");
  const [countdown, setCountdown] = useState("");
  const [showRegisterForm, setShowRegisterForm] = useState(false);
  const [newRunner, setNewRunner] = useState({ name: "", email: "" });
  const [expandedWeeks, setExpandedWeeks] = useState([]);

  useEffect(() => {
    const marathonDate = new Date("2025-06-22T06:00:00");
    const remainingTime = marathonDate - new Date();
    setCountdown(
      remainingTime > 0
        ? `${Math.ceil(remainingTime / (1000 * 60 * 60 * 24))} dias restantes`
        : "A maratona já passou!"
    );

    setWeeks(Array.from({ length: 21 }, (_, i) => ({
      week: i + 1,
      hasWorkout: false,
      workout: {}
    })));
  }, []);

  const handleSearch = () => {
    if (!email) return setError("Por favor, insira um e-mail.");
    setError("");
    getRunnerByEmail(email)
      .then(({ data }) => {
        setSelectedRunner(data);
        loadWorkouts(data.email);
      })
      .catch(() => setError("Usuário não encontrado."));
  };

  const loadWorkouts = (email) => {
    getWorkoutsForRunner(email)
      .then(({ data }) => {
        setWeeks((prevWeeks) => prevWeeks.map((week) => {
          const workout = data.find((w) => w.week === week.week);
          return workout
            ? { ...week, hasWorkout: true, workout: workout.trainingWeek }
            : week;
        }));
      })
      .catch(() => setError("Erro ao carregar treinos."));
  };

  return (
    <div className="container">
      <Header />
      <main className="main-content">
        <h1 className="title">PERSONAL MARATHON</h1>
        {error && <p className="error">{error}</p>}

        {!selectedRunner && !showRegisterForm && (
          <div className="countdown-container">
            <h2>Contagem Regressiva</h2>
            <p>{countdown}</p>
          </div>
        )}

        {!selectedRunner && !showRegisterForm && (
          <div className="search-container">
            <input type="email" placeholder="E-mail" value={email} onChange={(e) => setEmail(e.target.value)} />
            <button onClick={handleSearch}>Buscar</button>
          </div>
        )}

        {selectedRunner && (
          <div className="runner-details">
            <h3>{selectedRunner.name}</h3>
            <h4>Treinos Semanais</h4>
            <div className="training-weeks">
              {weeks.map((week) => (
                <div key={week.week} className="week-card">
                  <div className="week-header" onClick={() => setExpandedWeeks((prev) => prev.includes(week.week) ? prev.filter(w => w !== week.week) : [...prev, week.week])}>
                    <span>Semana {week.week}</span>
                    <span>{expandedWeeks.includes(week.week) ? "▲" : "▼"}</span>
                  </div>
                  {expandedWeeks.includes(week.week) && week.hasWorkout && (
                    <div className="workout-list">
                      {Object.entries(week.workout).map(([day, value]) => (
                        <p key={day}><strong>{day}:</strong> {value || "Sem treino"}</p>
                      ))}
                    </div>
                  )}
                </div>
              ))}
            </div>
          </div>
        )}
      </main>
      <Footer />
    </div>
  );
};

export default Home;
